Charles de Ganahl was born on July 27, 1869 in Texas. He was an adventurer at heart and his love for travel started young. After attending military school in Georgia, college in Texas and business school in New York, Charles jumped at the chance to work in Mexico City as a reporter. It was there he entered the world of business and never looked back. Throughout his life, Charles organized enterprises on three continents. His bevy of businesses was involved in sugar production, river transportation, ship building, exploration, gold mining in Africa and British Columbia, airplane manufacturing and oil production.<br />
His success in multiple businesses was a testament to not only his entrepreneurial prowess, but also his commanding personality and infectious energy. At the Medway Oil and Storage Company on the Isle of Grain in Kent, England, Fred noticed this vigor immediately and Charles quickly became a mentor to his chief engineer<br />
